import {USER_INFORMATION} from '../actions/types'
import state from '../state'

let initialState = {...state}

console.log('find the state ?  this is for updates',initialState)

export default function(initialState, action){
    console.log('nav bar action payload',action.payload)
    switch(action.type){
        case USER_INFORMATION:
        let newState = [{...initialState.userInfo}]
        return newState = action.payload.userInfo
        default: return state
    }

}
